The text analyzer combines the tokenizer with some filters and uses it to parse the text of the field. For example, write as follows: { "lang_en": { "tokenizer": { "name": "simple" }, "filters": [ { "name": "remove_long", "args": { "length_limit": 40 } }, { "name": "ascii_folding" }, { "name": "lower_case" }, { "name": "stemming", "args": { "stemmer_algorithm": "english" } }, { "name": "stop_word", "args": { "words": [ "a", "an", "and", "are", "as", "at", "be", "but", "by", "for", "if", "in", "into", "is", "it", "no", "not", "of", "on", "or", "such", "that", "the", "their", "then", "there", "these", "they", "this", "to", "was", "will", "with" ] } } ] }
} The field uses the above text analyzer are described as follows: [ { "name": "description", "type": "text", "options": { "indexing": { "record": "position", "tokenizer": "lang_en" }, "stored": true } }
